import Colors from "../css/Colors";

const MaterialGroupPageStyle = {
    headerShown: true,
    headerTitle: "Filter By: Material Group",
    headerTintColor: Colors.whiteColor,
    headerStyle: {
      backgroundColor: Colors.pageBgColor,
    },
}

export default MaterialGroupPageStyle
